import React from 'react';
import { Button } from './Button.js';
import '../App.css';
import './Panel.css';

function Panel(props) {
    return (
        <div className='panel-container' style={{ backgroundImage: `url(${props.Background})` }}>
            <h1>BRING YOUR BRAND TO LIFE</h1>
            <p>It all starts with a stunning website and killer user experience.</p>
            <div className='hero-btns'>
                <Button
                    className='btn'
                    buttonStyle='btn--outline'
                    buttonSize='btn--large'
                >
                    GET STARTED
                </Button>
                <Button
                    className='btn'
                    buttonStyle='btn--primary'
                    buttonSize='btn--large'
                    onClick={console.log('test')}
                >
                    WATCH TRAILER <i className='far fa-play-circle' />
                </Button>
            </div>
            <div className='hero-arrs'>
                <Arrow
                        className='arr'
                        buttonStyle='arr--primary'
                        buttonSize='arr--large'
                        onClick={console.log('test')}
                    >
                        <FontAwesomeIcon icon={faAngleDoubleDown} />
                </Arrow>
            </div>
        </div>
    );
}

export default Panel;
